const Text = ({selectedItem})=>{
    
    const degreeSymbol = '\u00B0';
    
    return <div className="Text">
        <div>{selectedItem.DayTemp}{degreeSymbol}C/ {selectedItem.NightTemp.toFixed}{degreeSymbol}C</div>
        <div></div>
    </div>
    
}

export default Text;
